import{_ as a,o as e,c as l,R as t}from"./chunks/framework.8sEIyQcJ.js";const _=JSON.parse('{"title":"回溯2023：职迹星图、生活新境界、自我超越","description":"1、职迹星图：深耕细作的产品之旅\\n2、生活新境界：品味生命的多彩\\n3、自我超越：突破舒适区的奇迹","frontmatter":{"title":"回溯2023：职迹星图、生活新境界、自我超越","date":"2023-12-31 16:47:41","updated":"2024-02-05 10:06:11","tags":["心悦神怡看世界"],"description":"1、职迹星图：深耕细作的产品之旅\\n2、生活新境界：品味生命的多彩\\n3、自我超越：突破舒适区的奇迹"},"headers":[],"relativePath":"happy/回溯2023：职迹星图、生活新境界、自我超越.md","filePath":"happy/回溯2023：职迹星图、生活新境界、自我超越.md","lastUpdated":null}'),i={name:"happy/回溯2023：职迹星图、生活新境界、自我超越.md"},r=t('<h1 id="回溯2023-职迹星图、生活新境界、自我超越" tabindex="-1">回溯2023：职迹星图、生活新境界、自我超越 <a class="header-anchor" href="#回溯2023-职迹星图、生活新境界、自我超越" aria-label="Permalink to &quot;回溯2023：职迹星图、生活新境界、自我超越&quot;">​</a></h1><p><img src="//cdn.fengxiaoqiang.com/happy/440585fe7a7518cf76995a1fc97ecd53.png" alt="2024.png"></p><h2 id="职迹星图-深耕细作的产品之旅" tabindex="-1">职迹星图：深耕细作的产品之旅 <a class="header-anchor" href="#职迹星图-深耕细作的产品之旅" aria-label="Permalink to &quot;职迹星图：深耕细作的产品之旅&quot;">​</a></h2><blockquote><p>专注于每个产品细节和迭代，体验成为产品从概念到实现过程中的一部分，感受在这个旅程中的每一步成长和进步。</p></blockquote><p>过去一年，身边好几个朋友都面临公司开猿节流，降本增笑的情况。🙂<br> 感觉整个大环境都在变化了，公司在产品规划策略上也做调整，开始往大KA项目资源倾斜。<br> 也因为这个调整，把自身使用过的系统进行了SaaS化改造，从而变的更通用性。<br> 在整个过程中，梳理出已用系统的一些设计不合理的地方，对齐进行了吐槽。<br> 以下分享几点可讲：</p><ul><li>从系统功能来说是很强大的，但是放开给外部客户使用后，就变得很重，操作不连贯需要分开多个地方进行</li><li>当初设计者的设计方案局限性，导致了很多数据产品数据出现冗余，而需要进行定时同步的机制</li><li>产品线与产品线之间相对独立，当整合在同一个SaaS系统后，除了前面提到操作不连贯外，还出现交互风格不一致</li><li>落地实施流程缺乏经验以及规范性，导致每个KA选购SaaS服务后，初始化部署需要花比较大的时间</li></ul><p>下半年接触了工业物联网（IIOT）方向的项目，了解了很多新名称以及新概念，可以是也是一个新的体验。<br> 虽然项目上线后，还未产生较大的经济效益，但这个项目较为大的意义是让团队接触新的技术栈以及领域。</p><h2 id="生活新境界-品味生命的多彩" tabindex="-1">生活新境界：品味生命的多彩 <a class="header-anchor" href="#生活新境界-品味生命的多彩" aria-label="Permalink to &quot;生活新境界：品味生命的多彩&quot;">​</a></h2><blockquote><p>探索生活的丰富多彩，从日常的小乐趣到家庭的温馨时光，从身体健康到精神满足，发现生活的每一种可能。</p></blockquote><h3 id="家庭新成员——小悦悦" tabindex="-1">家庭新成员——小悦悦 <a class="header-anchor" href="#家庭新成员——小悦悦" aria-label="Permalink to &quot;家庭新成员——小悦悦&quot;">​</a></h3><p>2023年家庭迎来了新成员，她的到来，<br> 也让生活变得更精彩，同时自己也多了一份责任<br><img src="//cdn.fengxiaoqiang.com/happy/d08ebed5754352bc252a996f0d0b97d0.jpeg" alt="1428813426.jpg"></p><h3 id="家庭大支出——购车" tabindex="-1">家庭大支出——购车 <a class="header-anchor" href="#家庭大支出——购车" aria-label="Permalink to &quot;家庭大支出——购车&quot;">​</a></h3><p>在2023年的尾声，购入了人生第一台车，驾照拿了这么多年了，现在开车都是很紧张。说起交车环节，4S点刚好装修，连交车仪式都没，车停在路边随便拍了个照<br><img src="//cdn.fengxiaoqiang.com/happy/305df1eb2d2620f6f60aac321ed75adb.jpeg" alt="280928264.jpg"></p><h3 id="健康" tabindex="-1">健康 <a class="header-anchor" href="#健康" aria-label="Permalink to &quot;健康&quot;">​</a></h3><p>今年国庆全家都二阳了，包括才3个月的女儿。比之前的症状跟严重，肌肉酸痛。还好最后大家都挺过来了。<br><img src="//cdn.fengxiaoqiang.com/happy/bcafe78021bcd12ec949fcf02f759e34.jpeg" alt="979439882.jpg"></p><p>由于现在公司没有年度员工体检了，今年没有给家人去购买体检套餐是比较遗憾的一点。</p><h2 id="自我超越-突破舒适区的奇迹" tabindex="-1">自我超越：突破舒适区的奇迹 <a class="header-anchor" href="#自我超越-突破舒适区的奇迹" aria-label="Permalink to &quot;自我超越：突破舒适区的奇迹&quot;">​</a></h2><blockquote><p>面对挑战，勇敢突破自我设限，学习新技能，开拓视野。每一次的超越都是个人成长的象征，记录成长的每一个瞬间。</p></blockquote><h3 id="公众号" tabindex="-1">公众号 <a class="header-anchor" href="#公众号" aria-label="Permalink to &quot;公众号&quot;">​</a></h3><p>过去一年，一直坚持更新《有意思小周刊》，一共更新了40篇。也因为公众号认识了很多同行朋友，感受到大家的支持，让自己更有动力坚持更新下去。<br> 同时，在业余止于把<a href="https://fengxiaoqiang.com" target="_blank" rel="noreferrer">fengxiaoqiang.com</a>博客重新搭建起来了，并且进行了备案，其博客目前会同步公众号的《有意思小周刊》。</p><h3 id="个人成长" tabindex="-1">个人成长 <a class="header-anchor" href="#个人成长" aria-label="Permalink to &quot;个人成长&quot;">​</a></h3><p>今年看的书比较少，看的比较多的是育儿相关的书籍，比如《美国儿科学会育儿百科》《崔玉涛育儿百科》，过去一年技能都点在育儿知识方面了，为人父母后才体会到了这一份责任心。除了这些这些外，看了《金钱心理学》、《亚马逊逆向工作法》</p><h2 id="_2024-flag" tabindex="-1">2024 Flag <a class="header-anchor" href="#_2024-flag" aria-label="Permalink to &quot;2024 Flag&quot;">​</a></h2><h3 id="工作" tabindex="-1">工作 <a class="header-anchor" href="#工作" aria-label="Permalink to &quot;工作&quot;">​</a></h3><ul class="task-list"><li class="task-list-item"><input type="checkbox" id="cbx_0" disabled="true"><label for="cbx_0"> 升职加薪（够直白）</label></li><li class="task-list-item"><input type="checkbox" id="cbx_1" disabled="true"><label for="cbx_1"> 提升所负责项目的用户体验</label></li></ul><h3 id="生活" tabindex="-1">生活 <a class="header-anchor" href="#生活" aria-label="Permalink to &quot;生活&quot;">​</a></h3><ul class="task-list"><li class="task-list-item"><input type="checkbox" id="cbx_2" disabled="true"><label for="cbx_2"> 启动视频号：心悦神怡看世界</label></li><li class="task-list-item"><input type="checkbox" id="cbx_3" disabled="true"><label for="cbx_3"> 还车贷</label></li><li class="task-list-item"><input type="checkbox" id="cbx_4" disabled="true"><label for="cbx_4"> 做一次年度体检</label></li><li class="task-list-item"><input type="checkbox" id="cbx_5" disabled="true"><label for="cbx_5"> 做更多的烘焙美食</label></li></ul><h3 id="个人成长-1" tabindex="-1">个人成长 <a class="header-anchor" href="#个人成长-1" aria-label="Permalink to &quot;个人成长&quot;">​</a></h3><ul class="task-list"><li class="task-list-item"><input type="checkbox" id="cbx_6" disabled="true"><label for="cbx_6"> 坚持公众号更新</label></li><li class="task-list-item"><input type="checkbox" id="cbx_7" disabled="true"><label for="cbx_7"> 扩展<a href="https://fengxiaoqiang.com" target="_blank" rel="noreferrer">fengxiaoqiang.com</a>博客栏目</label></li><li class="task-list-item"><input type="checkbox" id="cbx_8" disabled="true"><label for="cbx_8"> 看6本书（平均2个月看一本，应该能完成）</label></li></ul><h1 id="总结" tabindex="-1">总结 <a class="header-anchor" href="#总结" aria-label="Permalink to &quot;总结&quot;">​</a></h1><p>回溯2023，这是一年的深耕与丰收，职业上的稳步前行，生活中的丰富多彩，以及个人成长的不断超越。在未来的2024年，我期待继续这段旅程，不断提升自我，探索新的可能，实现更多的梦想，迎接每一个挑战与机遇。</p>',31),c=[r];function o(s,b,d,n,h,p){return e(),l("div",null,c)}const f=a(i,[["render",o]]);export{_ as __pageData,f as default};
